    "source": "// SPDX-License-Identifier: MIT\r\npragma solidity >=0.7.0 <0.9.0;\r\n\r\ncontract DepositContract {\r\n    \r\n    struct Deposit {\r\n        uint index;\r\n        string hash;\r\n        uint amount;\r\n        uint fee;\r\n        string ref;\r\n        address owner;\r\n        bool withdrawn;\r\n        bool reversed;\r\n        bool blocked;\r\n        address withdrawer;\r\n        uint timestamp;\r\n        bool active;\r\n    }\r\n    \r\n    struct Fee {\r\n        uint id;\r\n        uint min;\r\n        uint max;\r\n        uint deposit;\r\n        uint reversal;\r\n    }\r\n    \r\n    struct Statistic {\r\n        uint numberOfDeposits;\r\n        uint numberOfWithdrawals;\r\n        uint numberOfReversals;\r\n        uint totalDeposits;\r\n        uint totalWithdrawals;\r\n        uint totalReversals;\r\n        uint totalFees;\r\n        uint activeValue;\r\n    }\r\n    \r\n    struct Response {\r\n        uint index;\r\n        Deposit[] deposits;\r\n    }\r\n    \r\n    address private contractOwner;\r\n    address private withdrawAddress;\r\n    Fee[] private fees;\r\n    Statistic private stats;\r\n    mapping (uint => Deposit) private deposits;\r\n    mapping (uint => uint[]) private blocked;\r\n    mapping (address => uint[]) private depositsByAddress;\r\n    \r\n    constructor() payable {\r\n        contractOwner = msg.sender;\r\n    }\r\n    \r\n    event DepositEvent(Deposit);\r\n    event Received(address, uint);\r\n    receive() external payable {}\r\n    \r\n    // Begin -------------- Init --------------\r\n    function connect(address owner) public {\r\n        require(owner == contractOwner, \"Access denied.\");\r\n        withdrawAddress = msg.sender;\r\n    }\r\n    // End ---------------- Init --------------\r\n    \r\n    \r\n    // Begin -------------- Fees --------------\r\n    function setFees(uint[] memory uuidArr, uint[] memory minArr, uint[] memory maxArr, uint[] memory depositArr, uint[] memory reversalArr) external { // Sets Fees\r\n        require(msg.sender == contractOwner, \"Access denied.\");\r\n        delete fees;\r\n        for (uint i = 0; i < uuidArr.length; i++) {\r\n            fees.push(Fee(uuidArr[i], minArr[i], maxArr[i], depositArr[i], reversalArr[i]));\r\n        }\r\n    }\r\n    \r\n    function getFees() external view returns(Fee[] memory) { // Gets Fees\r\n        return fees;\r\n    }\r\n    \r\n    function getDepositFee(uint value) public view returns(uint) { // Selects Deposit Fee\r\n        Fee memory fee;\r\n        for (uint i = 0; i < fees.length; i++) {\r\n            fee = fees[i];\r\n            if (value >= fee.min && value <= fee.max) {\r\n                return fee.deposit;\r\n            }\r\n        }\r\n        return fees[fees.length - 1].deposit;\r\n    }\r\n    \r\n    function getReversalFee(uint value) public view returns(uint) { // Selects Reversal Fee\r\n        Fee memory fee;\r\n        for (uint i = 0; i < fees.length; i++) {\r\n            fee = fees[i];\r\n            if (value >= fee.min && value <= fee.max) {\r\n                return fee.reversal;\r\n            }\r\n        }\r\n        return fees[fees.length - 1].reversal;\r\n    }\r\n    // End   -------------- Fees --------------\r\n    \r\n    \r\n    // Begin -------------- Stats --------------\r\n    function getStatistics() external view returns(Statistic memory) {\r\n        require(msg.sender == contractOwner, \"Access denied.\");\r\n        return stats;\r\n    }\r\n    // End   -------------- Stats --------------\r\n    \r\n    \r\n    // Begin -------------- Deposit --------------\r\n    function deposit(string memory hash, uint amount, string memory ref, uint timestamp) external payable {\r\n        uint fee = getDepositFee(amount);\r\n        require(msg.value == (amount + fee), \"Invalid amount.\");\r\n        deposits[stats.numberOfDeposits] = Deposit(stats.numberOfDeposits, hash, amount, fee, ref, msg.sender, false, false, false, address(0), timestamp, true);\r\n        depositsByAddress[msg.sender].push(stats.numberOfDeposits);\r\n        \r\n        stats.numberOfDeposits++;\r\n        stats.totalDeposits += amount;\r\n        stats.activeValue += amount;\r\n        stats.totalFees += fee;\r\n        \r\n        emit DepositEvent(deposits[stats.numberOfDeposits - 1]);\r\n    }\r\n    \r\n    function reverse(uint index) external {\r\n        Deposit memory dep = deposits[index];\r\n        require(dep.active, \"Deposit is not active.\");\r\n        require(msg.sender == dep.owner, \"Access denied.\");\r\n        uint fee = getReversalFee(dep.amount);\r\n        uint amount = dep.amount - fee;\r\n        stats.numberOfReversals++;\r\n        stats.totalReversals += amount;\r\n        stats.totalFees += fee;\r\n        stats.activeValue -= deposits[index].amount;\r\n        deposits[index].reversed = true;\r\n        deposits[index].active = false;\r\n        \r\n        pay(msg.sender, amount);\r\n    }\r\n    \r\n    function getDeposit(uint index) external view returns(Deposit memory) {\r\n        return deposits[index];\r\n    }\r\n    \r\n    function getDeposits(uint index, uint count) external view returns(Response memory) {\r\n        uint[] memory posList = depositsByAddress[msg.sender];\r\n        index = index > 0 ? index : posList.length;\r\n        count = count < posList.length ? count : posList.length;\r\n        count = count <= index ? count : index;\r\n        Deposit[] memory depositList = new Deposit[](count);\r\n        \r\n        for (uint i = 0; i < count; i++) {\r\n            depositList[i] = deposits[posList[index - 1]];\r\n            index--;\r\n        }\r\n        \r\n        return Response(index, depositList);\r\n    }\r\n    \r\n    function getDepositsByAddress(address user, uint index, uint count) external view returns(Response memory) {\r\n        uint[] memory posList = depositsByAddress[user];\r\n        index = index > 0 ? index : posList.length;\r\n        count = count < posList.length ? count : posList.length;\r\n        count = count <= index ? count : index;\r\n        Deposit[] memory depositList = new Deposit[](count);\r\n        \r\n        for (uint i = 0; i < count; i++) {\r\n            depositList[i] = deposits[posList[index - 1]];\r\n            index--;\r\n        }\r\n        \r\n        return Response(index, depositList);\r\n    }\r\n    // End   -------------- Deposit --------------\r\n    \r\n    \r\n    // Begin -------------- Withdraw --------------\r\n    function withdraw(uint index, address to) public {\r\n        require(msg.sender == withdrawAddress, \"Access Denied.\");\r\n        Deposit memory dep = deposits[index];\r\n        require(dep.active, \"Deposit not found.\");\r\n        require(!dep.blocked, \"Deposit blocked.\");\r\n        require(!dep.withdrawn, \"Deposit withdrawn.\");\r\n        require(!dep.reversed, \"Deposit reversed.\");\r\n        \r\n        pay(to, dep.amount);\r\n        \r\n        deposits[index].withdrawer = to;\r\n        deposits[index].withdrawn = true;\r\n        deposits[index].active = false;\r\n        \r\n        stats.numberOfWithdrawals++;\r\n        stats.totalWithdrawals += dep.amount;\r\n        stats.activeValue -= dep.amount;\r\n    }\r\n    // End   -------------- Withdraw --------------\r\n    \r\n    // Begin -------------- General --------------\r\n    function pay(address to, uint256 value) internal {\r\n        address payable receiver = payable(to);\r\n        receiver.transfer(value);\r\n        emit Received(to, value);\r\n    }\r\n    \r\n    function cashout(uint amount) external {\r\n        require(msg.sender == contractOwner, \"Access denied.\");\r\n        pay(msg.sender, amount);\r\n        emit Received(msg.sender, amount);\r\n    }\r\n    // End   -------------- General --------------\r\n}",
